    <title>FreeStyle更新包图片资源展示 - 增强版</title>
    <style>
        body {
            font-family: 'Microsoft YaHei', Arial, sans-serif;
            margin: 0;
            padding: 20px;
            background: linear-gradient(135deg, #667eea 0%, #764ba2 100%);
            color: #333;
        }
        .container {
            max-width: 1800px;
            margin: 0 auto;
            background: white;
            border-radius: 15px;
            box-shadow: 0 10px 30px rgba(0,0,0,0.3);
            overflow: hidden;
        }
        .header {
            background: linear-gradient(135deg, #4facfe 0%, #00f2fe 100%);
            color: white;
            padding: 30px;
            text-align: center;
        }
        .header h1 {
            margin: 0;
            font-size: 2.5em;
            text-shadow: 2px 2px 4px rgba(0,0,0,0.3);
        }
        .content {
            padding: 30px;
        }
        .controls {
            display: flex;
            justify-content: space-between;
            align-items: center;
            margin-bottom: 20px;
            flex-wrap: wrap;
            gap: 10px;
            background: #f8f9fa;
            padding: 20px;
            border-radius: 10px;
        }
        .filter-btn {
            background: #4facfe;
            color: white;
            border: none;
            padding: 8px 16px;
            border-radius: 5px;
            cursor: pointer;
            transition: background 0.3s;
        }
        .filter-btn:hover {
            background: #45a049;
        }
        .filter-btn.active {
            background: #27ae60;
        }
        .view-btn {
            background: #6c757d;
            color: white;
            border: none;
            padding: 8px 16px;
            border-radius: 5px;
            cursor: pointer;
            transition: background 0.3s;
        }
        .view-btn:hover {
            background: #5a6268;
        }
        .view-btn.active {
            background: #495057;
        }
        .image-grid {
            display: grid;
            grid-template-columns: repeat(auto-fill, minmax(200px, 1fr));
            gap: 20px;
            margin-top: 20px;
        }
        .image-grid.list-view {
            grid-template-columns: 1fr;
            gap: 10px;
        }
        .image-card {
            background: white;
            border-radius: 8px;
            padding: 15px;
            box-shadow: 0 4px 6px rgba(0,0,0,0.1);
            text-align: center;
            transition: transform 0.3s, box-shadow 0.3s;
        }
        .image-card.list-view {
            display: flex;
            align-items: center;
            text-align: left;
            padding: 10px;
        }
        .image-card:hover {
            transform: translateY(-5px);
            box-shadow: 0 8px 25px rgba(0,0,0,0.2);
        }
        .image-preview {
            width: 100%;
            height: 150px;
            object-fit: cover;
            border-radius: 5px;
            margin-bottom: 10px;
            border: 2px solid #e0e0e0;
            cursor: pointer;
            transition: transform 0.3s;
        }
        .image-preview:hover {
            transform: scale(1.05);
        }
        .image-preview.list-view {
            width: 100px;
            height: 100px;
            margin-bottom: 0;
            margin-right: 15px;
        }
        .image-info {
            text-align: left;
        }
        .image-name {
            font-size: 0.9em;
            color: #333;
            font-weight: bold;
            margin-bottom: 5px;
            word-break: break-all;
        }
        .image-details {
            font-size: 0.8em;
            color: #666;
        }
        .pagination {
            display: flex;
            justify-content: center;
            align-items: center;
            margin-top: 20px;
            gap: 10px;
        }
        .pagination button {
            background: #4facfe;
            color: white;
            border: none;
            padding: 8px 12px;
            border-radius: 5px;
            cursor: pointer;
            transition: background 0.3s;
        }
        .pagination button:hover {
            background: #45a049;
        }
        .pagination button:disabled {
            background: #ccc;
            cursor: not-allowed;
        }
        .pagination .page-info {
            margin: 0 15px;
            font-weight: bold;
        }
        .modal {
            display: none;
            position: fixed;
            z-index: 1000;
            left: 0;
            top: 0;
            width: 100%;
            height: 100%;
            background-color: rgba(0,0,0,0.9);
        }
        .modal-content {
            background-color: white;
            margin: 2% auto;
            padding: 20px;
            border-radius: 10px;
            width: 90%;
            max-width: 1200px;
            max-height: 90%;
            overflow-y: auto;
            text-align: center;
            position: relative;
        }
        .close {
            color: #aaa;
            float: right;
            font-size: 28px;
            font-weight: bold;
            cursor: pointer;
            position: absolute;
            right: 20px;
            top: 15px;
        }
        .close:hover {
            color: #000;
        }
        .modal-image {
            max-width: 100%;
            max-height: 600px;
            border-radius: 5px;
            margin: 20px 0;
            box-shadow: 0 4px 20px rgba(0,0,0,0.3);
        }
        .modal-info {
            text-align: left;
            margin-top: 20px;
            padding: 20px;
            background: #f8f9fa;
            border-radius: 5px;
        }

            display: inline-block;
            background: #4facfe;
            color: white;
            padding: 10px 20px;
            text-decoration: none;
            border-radius: 5px;
            margin-top: 10px;
            transition: background 0.3s;
        }
        .download-link:hover {
            background: #45a049;
        }
        .navigation-buttons {
            display: flex;
            justify-content: space-between;
            margin-top: 20px;
        }
        .nav-btn {
            background: #6c757d;
            color: white;
            border: none;
            padding: 10px 20px;
            border-radius: 5px;
            cursor: pointer;
            transition: background 0.3s;
        }
        .nav-btn:hover {
            background: #5a6268;
        }
        .nav-btn:disabled {
            background: #ccc;
            cursor: not-allowed;
        }
        .stats {
            display: grid;
            grid-template-columns: repeat(auto-fit, minmax(200px, 1fr));
            gap: 20px;
            margin-bottom: 30px;
        }

            padding: 20px;

            text-align: center;
        }

            font-size: 2.5em;
            font-weight: bold;
            margin-bottom: 5px;
        }
    </style>
</head>

                    <button class="view-btn" onclick="changeView('list')">列表视图</button>

            </div>
            
            <!-- 图片展示区域 -->
            <div id="imageContainer">

            <!-- 分页控制 -->

                <button onclick="nextPage()" id="nextBtn">下一页</button>
            </div>
        </div>
    </div>
    
    <!-- 图片详情模态框 -->

                <button class="nav-btn" onclick="nextImage()" id="nextImageBtn">下一张 →</button>
            </div>
        </div>
    </div>

_5549_2d4cced6.png', 'size': 81864, 'pak_name': 'res705'}, {'name': 'res705_image_5546_16ed4d4f.png', 'path': 'res705/res705_image_5546_16ed4d4f.png', 'size': 126028, 'pak_name': 'res705'}];
        let currentFilter = 'all';
        let currentView = 'grid';
        let currentPage = 1;
        let imagesPerPage = 50;
        let currentImageIndex = 0;
        let filteredImages = [];
        
        // 初始化
        document.addEventListener('DOMContentLoaded', function() {
            filterImages('all');
        });
        
        // 筛选图片
        function filterImages(filter) {
            currentFilter = filter;
            currentPage = 1;
            
            // 更新按钮状态
            document.querySelectorAll('.filter-btn').forEach(btn => {
                btn.classList.remove('active');
            });
            event.target.classList.add('active');
            
            // 筛选图片
            if (filter === 'all') {
                filteredImages = allImages;
            } else {
                filteredImages = allImages.filter(img => {
                    const pakName = img.pak_name;
                    if (filter === 'ur_emblem') return pakName.includes('ur_emblem');
                    if (filter === 'title') return pakName.includes('title');
                    if (filter === 'effect2') return pakName.includes('effect2');
                    if (filter === 'icon') return pakName.includes('icon');
                    if (filter === 'res') return pakName.startsWith('res');
                    if (filter === 'ur_event') return pakName.includes('ur_event');
                    return false;
                });
            }
            
            renderImages();
        }
        
        // 切换视图
        function changeView(view) {
            currentView = view;
            
            // 更新按钮状态
            document.querySelectorAll('.view-btn').forEach(btn => {
                btn.classList.remove('active');
            });
            event.target.classList.add('active');
            
            renderImages();
        }
        
        // 渲染图片
        function renderImages() {
            const startIndex = (currentPage - 1) * imagesPerPage;
            const endIndex = startIndex + imagesPerPage;
            const pageImages = filteredImages.slice(startIndex, endIndex);
            
            // 更新分页信息
            const totalPages = Math.ceil(filteredImages.length / imagesPerPage);
            document.getElementById('pageInfo').textContent = `第 ${currentPage} 页，共 ${totalPages} 页`;
            document.getElementById('prevBtn').disabled = currentPage <= 1;
            document.getElementById('nextBtn').disabled = currentPage >= totalPages;
            
            // 渲染图片网格
            const grid = document.getElementById('imageGrid');
            grid.className = `image-grid ${currentView === 'list' ? 'list-view' : ''}`;
            
            let html = '';
            pageImages.forEach((img, index) => {
                const globalIndex = startIndex + index;
                html += `
                    <div class="image-card ${currentView === 'list' ? 'list-view' : ''}">
                        <img src="${img.path}" 
                             alt="${img.name}" 
                             class="image-preview ${currentView === 'list' ? 'list-view' : ''}"
                             onclick="showImageModal(${globalIndex})">
                        <div class="image-info">
                            <div class="image-name">${img.name}</div>
                            <div class="image-details">
                                大小: ${(img.size/1024).toFixed(1)} KB<br>
                                来源: ${img.pak_name}
                            </div>
                            <a href="${img.path}" download class="download-link">下载</a>
                        </div>
                    </div>`;
            });
            
            grid.innerHTML = html;
        }
        
        // 分页功能
        function previousPage() {
            if (currentPage > 1) {
                currentPage--;
                renderImages();
            }
        }
        
        function nextPage() {
            const totalPages = Math.ceil(filteredImages.length / imagesPerPage);
            if (currentPage < totalPages) {
                currentPage++;
                renderImages();
            }
        }
        
        // 显示图片模态框
        function showImageModal(index) {
            currentImageIndex = index;
            const img = filteredImages[index];
            const modal = document.getElementById('imageModal');
            const modalImage = document.getElementById('modalImage');
            
            modalImage.innerHTML = `
                <h3>${img.name}</h3>
                <img src="${img.path}" alt="${img.name}" class="modal-image">
                <div class="modal-info">
                    <h4>图片信息:</h4>
                    <p><strong>文件名:</strong> ${img.name}</p>
                    <p><strong>文件大小:</strong> ${(img.size/1024).toFixed(1)} KB</p>
                    <p><strong>来源PAK:</strong> ${img.pak_name}</p>
                    <p><strong>图片索引:</strong> ${index + 1} / ${filteredImages.length}</p>
                </div>
                <a href="${img.path}" download class="download-link">下载原图</a>
            `;
            
            // 更新导航按钮状态
            document.getElementById('prevImageBtn').disabled = index <= 0;
            document.getElementById('nextImageBtn').disabled = index >= filteredImages.length - 1;
            
            modal.style.display = 'block';
        }
        
        // 图片导航
        function previousImage() {
            if (currentImageIndex > 0) {
                showImageModal(currentImageIndex - 1);
            }
        }
        
        function nextImage() {
            if (currentImageIndex < filteredImages.length - 1) {
                showImageModal(currentImageIndex + 1);
            }
        }
        
        function closeModal() {
            document.getElementById('imageModal').style.display = 'none';
        }
        
        // 键盘事件
        document.addEventListener('keydown', function(event) {
            if (event.key === 'Escape') {
                closeModal();
            } else if (event.key === 'ArrowLeft') {
                if (document.getElementById('imageModal').style.display === 'block') {
                    previousImage();
                } else {
                    previousPage();
                }
            } else if (event.key === 'ArrowRight') {
                if (document.getElementById('imageModal').style.display === 'block') {
                    nextImage();
                } else {
                    nextPage();
                }
            }
        });
        
        // 点击模态框外部关闭
        window.onclick = function(event) {
            const modal = document.getElementById('imageModal');
            if (event.target === modal) {
                modal.style.display = 'none';
            }
        }
    </script>
